const ProjectComponents =({ float , intro, title, content, btnClass='', btn, icon, flip = false, id ,link='maportfolioo',more}) => {


    var textfloat='';
    if(float == 'Right'){
textfloat='left'
    }else    if(float == 'Left'){
        textfloat='right'

    }


    return(

        <div  className=" ProjectCard theme-btn-five aos-init aos-animate"data-aos="fade-up" data-aos-duration="1200"data-aos-delay="4000"    data-aos-duration="1000">
     <div className="sText"  style={{float:textfloat}}>
                    <div className="skillIcon" >
                        <video autoPlay="" muted="" loop=""
                               src="https://res.cloudinary.com/parmeetsinghasija/video/upload/v1648038674/projects/condexo-pay/condexo-pay__landing-page--old_zxl90m_gq9t2z.mp4"
                               className="projects-section__Video-sc-1r8qvbm-16 cShTjf"></video></div>
                    <div className="skillTitle">{title}</div>
         <p className="para" data-aos="fade-up" data-aos-duration="2000">{content}</p>


         <Link className='btn' to={{ pathname: `${more}` }} target="_blank">{btn}</Link>
     </div>

         <div className="ProjectCardInner" style={{float:float}} id={id}></div>
        </div>
    )
}





export default ProjectComponents;
